<!-- JavaScript for Save as PDF -->
<script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.4.0/jspdf.umd.min.js"></script>
<script>
    document.addEventListener("DOMContentLoaded", function() {
        const urlParams = new URLSearchParams(window.location.search);
        if (urlParams.has('success') && urlParams.has('appointment_id')) {
            document.getElementById("successModal").style.display = "block";
        }
    });

    function fetchAndDownloadPDF() {
        const urlParams = new URLSearchParams(window.location.search);
        const appointmentId = urlParams.get('appointment_id');

        if (!appointmentId) {
            alert("No appointment ID found.");
            return;
        }

        fetch(`<?php echo admin_url('admin-ajax.php'); ?>?action=fetch_appointment_details&appointment_id=${appointmentId}`)
            .then(response => response.json())
            .then(data => {
                if (data.success) {
                    generatePDF(data.data);
                } else {
                    alert("Error fetching appointment details.");
                }
            })
            .catch(error => console.error('Error:', error));
    }

    function generatePDF(appointmentData) {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    // Add a logo (replace URL with your logo's link)
    const logoUrl = "data:image/jpeg;base64,";
    const imgWidth = 50; 
    const imgHeight = 20;
    doc.addImage(logoUrl, "PNG", (210 - imgWidth) / 2, 10, imgWidth, imgHeight); // Centered logo

    // Title
    doc.setFont("helvetica", "bold");
    doc.setFontSize(18);
    doc.text("Appointment Confirmation", 105, 40, { align: "center" });

    // Formatting the content
    doc.setFont("helvetica", "normal");
    doc.setFontSize(12);
    
    let y = 60; // Initial Y position
    const lineHeight = 10; // Line spacing

    function addText(label, value) {
        doc.setFont("helvetica", "bold");
        doc.text(`${label}:`, 20, y);
        doc.setFont("helvetica", "normal");
        doc.text(`${value || "N/A"}`, 70, y);
        y += lineHeight;
    }

    addText("Full Name", appointmentData.full_name);
    addText("Phone", appointmentData.phone);
    addText("Email", appointmentData.email);
    addText("Telegram Username", appointmentData.telegram_username);
		addText("Required Field", appointmentData.required_field);
		addText("Current Education", appointmentData.current_education);
		addText("Current Field", appointmentData.current_field);
		addText("State", appointmentData.state);
		addText("Remark", appointmentData.remark);
    addText("Appointment Date", appointmentData.appointment_date);

    // Footer
    doc.setFontSize(10);
    doc.setTextColor(100);
    doc.text("Thank you for booking an appointment with us!", 105, 240, { align: "center" });
		doc.text("+251913197973,+251910221297,+251932211023", 105, 250, { align: "center" });
doc.text("Wollo Sefer, Ethio China Friendship Road, KAS Tower, 1st Floor, Office Number 104", 105, 260, { align: "center" });
    // Save the PDF
    doc.save("Appointment_Details.pdf");
}
function redirectToHome() {
    window.location.href = "<?php echo esc_url(home_url()); ?>";
}

</script>
